import React from "react";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import SearchPage from "./components/SearchPage"; // SearchPage component for the search page"
import Home from "./Home"; // Home component for the main page

class App extends React.Component {
  render() {
    return (
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/search">Search</Link>
              </li>
            </ul>
          </nav>

          <Switch>
            <Route path="/search">
              <SearchPage />
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
